<!doctype html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport"
          content="width=device-width, user-scalable=no, initial-scale=1.0, maximum-scale=1.0, minimum-scale=1.0">
    <meta http-equiv="X-UA-Compatible" content="ie=edge">
    <title>New-Year-PB 4</title>
    <link rel="preconnect" href="https://fonts.googleapis.com">
    <link rel="preconnect" href="https://fonts.gstatic.com" crossorigin>
    <link href="https://fonts.googleapis.com/css2?family=Playfair+Display:wght@900&display=swap" rel="stylesheet">
    <style>
        * {
            padding: 0;
            margin: 0;
            -webkit-box-sizing: border-box;
            -moz-box-sizing: border-box;
            box-sizing: border-box;
        }
        body {
            height: 100vh;
            overflow: hidden;
            background-color: #F52326;
            font-family: 'Playfair Display', serif;
            font-style: normal;
            font-weight: normal;
            color: #FEF8F8;
        }
        main {
            max-width: 377px;
            margin: 0 auto;
            height: -webkit-fill-available;
            padding: 6px 0 6px;
        }
        .logo {
            margin: 0 auto 20px;
            width: 323px;
            height: 84px;
        }
        .logo img {
            width: 100%;
            height: 100%;
        }
        .text-limited {
            margin: 8px auto 18px;
            text-align: center;
            font-weight: 900;
            font-size: 30px;
            line-height: 40px;
        }
        .player {
            margin: 0 auto 8px;
        }
        .player img {
            width: 100%;
            height: 100%;
        }
        .btn {
            display: flex;
            justify-content: center;
            align-items: center;
            margin: 0 auto;
            width: 95%;
            min-height: 78px;

            background: #0B0B0B;
            border: 3px solid #FFFFFF;
            border-radius: 11px;

            font-weight: 900;
            font-size: 30px;
            line-height: 40px;
            color: #FFFFFF;
            text-decoration: none;
            text-align: center;
        }

        /*media -----------------------------*/

        @media (min-height: 750px) {
            main {
                display: flex;
                flex-direction: column;
                justify-content: center;
                padding-top: 0;
            }
        }

        @media (max-width: 412px) {
            main {
                max-width: 90%;
            }
        }

        @media (max-width: 600px) and (max-height: 690px) and (orientation: portrait) {
            .player {
            }
        }

        @media (max-width: 600px) and (max-height: 630px) and (orientation: portrait) {
            .player {
            }
        }

        @media (max-width: 560px) and (max-height: 570px) and (orientation: portrait) {
            .player {
            }
        }

        @media (max-width: 410px) and (orientation: portrait) {
            .btn {
                width: 90%;
            }
        }

        @media (max-width: 360px) and (orientation: portrait) {
            .logo {
                width: 100%;
                height: auto;
            }
            .text-limited {
                max-width: 90%;
                font-size: 28px;
            }
        }

        @media (max-width: 410px) and (max-height: 640px) and (orientation: portrait) {
            .text-limited {
                font-size: 24px;
            }
            .player {
            }
        }

        @media (max-width: 410px) and (max-height: 570px) and (orientation: portrait) {
            .player {
            }
            .text-limited {
                font-size: 21px;
            }
        }

        @media (max-width: 410px) and (max-height: 540px) and (orientation: portrait) {
            .player {
                width: 220px;
                height: 231px;
            }
            .btn {
                font-size: 34px;
            }
            .text-limited {
                margin-bottom: 10px;
            }
        }

        @media (max-width: 288px) and (orientation: portrait) {
            main {
                display: flex;
                flex-direction: column;
                justify-content: center;
                padding-top: 0;
            }
            .player {
            }
            .btn {
                /*font-size: 40px;*/
            }
            .text-limited {
                font-size: 19px;
                margin-top: 0;
            }
        }

        @media (max-height: 768px) and (orientation: landscape) {
            main {
                display: flex;
                flex-direction: column;
                justify-content: center;
                padding-top: 0;
            }
            .btn {
                margin: 10px auto 10px;
            }
        }

        @media (max-height: 540px) and (orientation: landscape) {
            .player {
            }
        }

        @media (max-height: 414px) and (orientation: landscape) {
            .player {
                display: none;
            }
        }

        @media (max-height: 320px) and (orientation: landscape) {
        }

        @media (max-height: 288px) and (orientation: landscape) {
            .text-limited {
                margin-bottom: 0;
            }
            .btn {
                /*min-height: auto;*/
                /*max-height: 50px;*/
                /*font-size: 40px;*/
            }
        }

    </style>
</head>
